local url = "https://test-fvc7.onrender.com/save"
local key = "PanelLegitGoat"

local function ler(g)
	local r = {}
	for _,v in pairs(g:GetChildren()) do
		if v:IsA("ImageButton") then
			local p = v:FindFirstChild("PName")
			local vl = v:FindFirstChild("V")
			if p and p:IsA("TextLabel") then
				local t = p.Text or ""
				local i,n = t:match("^(%d+)%.%s*(.+)$")
				i = tonumber(i) or 0
				n = n or t
				local v = 0
				if vl and vl:IsA("TextLabel") then
					v = tonumber(vl.Text) or 0
				end
				table.insert(r, {pos=i,nome=n,valor=v})
			end
		end
	end
	return r
end

local function s(l,t)
	for _,d in pairs(l) do
		local g = d[1]
		local f = d[2]
		local ok,res = pcall(ler,g)
		if ok then
			local j = {
				key = key,
				filename = t..f,
				data = {
					enviado_por = plr.Name,
					horario = os.date("%Y-%m-%d %H:%M:%S"),
					jogadores = res
				}
			}
			pcall(function()
				http_request({
					Url = url,
					Method = "POST",
					Headers = {["Content-Type"]="application/json"},
					Body = http:JSONEncode(j)
				})
			end)
		end
	end
end

